    //  no simd       96      138        0
    fn anti_reject_via_horizon_from(self, other: VersorOdd) -> Self::Output {
        use crate::elements::*;
        let wedge = VersorOdd::from_groups(
            // e41, e42, e43, scalar
            ((Simd32x3::from(other[scalar]) * self.group0().xyz()) + (Simd32x3::from(self[scalar]) * other.group0().xyz())).with_w(other[scalar] * self[scalar]),
            // e23, e31, e12, e45
            (Simd32x4::from(other[scalar]) * self.group1()) + (Simd32x4::from(self[scalar]) * other.group1()),
            // e15, e25, e35, e1234
            (Simd32x4::from(other[scalar]) * self.group2())
                + (Simd32x4::from(self[scalar]) * other.group2())
                + Simd32x3::from(0.0).with_w(
                    -(other[e41] * self[e23])
                        - (other[e42] * self[e31])
                        - (other[e43] * self[e12])
                        - (other[e23] * self[e41])
                        - (other[e31] * self[e42])
                        - (other[e12] * self[e43]),
                ),
            // e4235, e4315, e4125, e3215
            Simd32x4::from([
                (other[e23] * self[e45]) + (other[e45] * self[e23]) + (other[e35] * self[e42]) + (other[e4235] * self[scalar]),
                (other[e31] * self[e45]) + (other[e45] * self[e31]) + (other[e15] * self[e43]) + (other[e4315] * self[scalar]),
                (other[e12] * self[e45]) + (other[e45] * self[e12]) + (other[e25] * self[e41]) + (other[e4125] * self[scalar]),
                -(other[e12] * self[e35]) - (other[e15] * self[e23]) - (other[e25] * self[e31]) - (other[e35] * self[e12]),
            ]) + (other.group0().yzxw() * self.group2().zxy().with_w(self[e3215]))
                + (other.group0().www() * self.group3().xyz()).with_w(other[e3215] * self[scalar])
                - (self.group2().yzxx() * other.group0().zxy().with_w(other[e23]))
                - (other.group2().yzx() * self.group0().zxy()).with_w(other[e31] * self[e25]),
        );
        let right_dual = VersorEven::from_groups(
            // e423, e431, e412, e12345
            other.group0() * Simd32x4::from([-1.0, -1.0, -1.0, 1.0]),
            // e415, e425, e435, e321
            other.group1() * Simd32x4::from([-1.0, -1.0, -1.0, 1.0]),
            // e235, e315, e125, e5
            other.group2().xyz().with_w(other[e3215]) * Simd32x4::from([-1.0, -1.0, -1.0, 1.0]),
            // e1, e2, e3, e4
            other.group3().xyz().with_w(other[e1234]) * Simd32x4::from([-1.0, -1.0, -1.0, 1.0]),
        );
        return VersorOdd::from_groups(
            // e41, e42, e43, scalar
            (right_dual.group0().zxyw() * wedge.group3().yzx().with_w(wedge[scalar]))
                + Simd32x3::from(0.0).with_w(
                    (right_dual[e2] * wedge[e4315]) + (right_dual[e3] * wedge[e4125]) + (right_dual[e4] * wedge[e3215])
                        - (right_dual[e431] * wedge[e25])
                        - (right_dual[e412] * wedge[e35])
                        - (right_dual[e415] * wedge[e23])
                        - (right_dual[e425] * wedge[e31])
                        - (right_dual[e435] * wedge[e12])
                        - (right_dual[e321] * wedge[e45])
                        - (right_dual[e235] * wedge[e41])
                        - (right_dual[e315] * wedge[e42])
                        - (right_dual[e125] * wedge[e43]),
                )
                + (right_dual.group0().www() * wedge.group0().xyz()).with_w(right_dual[e5] * wedge[e1234])
                + (wedge.group2().www() * right_dual.group1().xyz()).with_w(right_dual[e1] * wedge[e4235])
                - (right_dual.group0().yzxx() * wedge.group3().zxy().with_w(wedge[e15])),
            // e23, e31, e12, e45
            Simd32x4::from([
                (right_dual[e12345] * wedge[e23]) + (right_dual[e235] * wedge[e1234]),
                (right_dual[e12345] * wedge[e31]) + (right_dual[e315] * wedge[e1234]),
                (right_dual[e12345] * wedge[e12]) + (right_dual[e125] * wedge[e1234]),
                -(right_dual[e425] * wedge[e4315]) - (right_dual[e435] * wedge[e4125]),
            ]) + (right_dual.group0() * wedge.group3().www().with_w(wedge[e45]))
                - (right_dual.group1().wwwx() * wedge.group3().xyzx()),
            // e15, e25, e35, e1234
            ((Simd32x3::from(right_dual[e12345]) * wedge.group2().xyz())
                + (Simd32x3::from(wedge[e3215]) * right_dual.group1().xyz())
                + (right_dual.group2().yzx() * wedge.group3().zxy())
                - (right_dual.group2().zxy() * wedge.group3().yzx()))
            .with_w(right_dual[e12345] * wedge[e1234]),
            // e4235, e4315, e4125, e3215
            Simd32x4::from(right_dual[e12345]) * wedge.group3(),
        );
    }
